import {
  createMuiTheme
} from "@material-ui/core/styles";

export default createMuiTheme({
  typography: {
    useNextVariants: true,
  },
  palette: {
    primary: {
      main: "#000000"
    },
    secondary: {
      main: "#BDBDBD"
    },
  }
});
export const defaultTheme = createMuiTheme({
  typography: {
    useNextVariants: true,
  },
  palette: {
    primary: {
      main: "#3f51b5"
    },
    secondary: {
      main: "#f50057"
    },
  }
});
